import React from 'react';
import { ReactComponent as CarSvg } from '../images/araba.svg'; // Assuming car.svg is in the same directory
import Yollar from '../images/yollar.png'
const MyComponent = () => {
    var carPosition = { left: '315px', top: '560px' };

    return (
        <div style={{ display: 'flex', marginLeft: '33%', marginTop:'15%' }}>
          <div style={{ position: 'relative', width: '600px', height: '600px', backgroundColor: 'green' }}>
            <img 
              src={Yollar} 
              alt="road" 
              style={{ 
                width: '100%', 
                height: '100%',
                position: 'absolute',
                zIndex: 1
              }}
            />
            <CarSvg 
              style={{ 
                width: '25px', 
                height: '25px',
                position: 'absolute',
                left: carPosition.left, 
                top: carPosition.top,
                zIndex: 2
              }} 
            />
          </div>
          <div>
            x: {carPosition.left}, y: {carPosition.top}, orientation: 0, speed: 20
            
          </div>
        </div>
      );
}

export default MyComponent;
